    ]
    {
        list.map((item) => {
            return (
                <li
                    key={item.id}
                    onClick={() => setActive(item)}
                    className={`list-group-item ${active == item && 'active'}`}
                >
                    {item.name}
                </li>
            )
        })
    }
    return (
        <nav className="navbar">
            <div className="container">
                <div className="nav-elements">
                    <ul>
                        <li>
                            <a href="/" className={active ? ' active' : 'nav-link'}>Accueil</a>
                        </li>
                        <li>
                            <a href="/Galerie" className='nav-link'>Galerie</a>
                        </li>
                        <li>
                            <a href="/Tarifs_et_Prestations" className='nav-link'>tarifs et prestations</a>
                        </li>
                        <li>
                            <a href="/Contact" className='nav-link'>Contact</a>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    )
}
export default Header;
